import React from "react";
import { Header } from "../components/assets/Header";
import { Footer } from "../components/assets/Footer";

export const Home = () => {
  return (
    <div>
      <Header />
      <div>
        <p>СОВЕТ</p> СТАРШЕКЛАССНИКОВ
      </div>
      <Footer />
    </div>
  );
};
